#!/bin/bash

# Script para criar estrutura completa do projeto PHP Docker
# Compatível com macOS, Linux e Windows (WSL)

set -e

# Cores para output
RED='\033[0;31m'
GREEN='\033[0;32m'
YELLOW='\033[1;33m'
BLUE='\033[0;34m'
PURPLE='\033[0;35m'
CYAN='\033[0;36m'
NC='\033[0m' # No Color

# Funções para output colorido
print_header() {
    echo -e "${PURPLE}================================${NC}"
    echo -e "${PURPLE}  PHP Docker Project Setup${NC}"
    echo -e "${PURPLE}================================${NC}"
    echo ""
}

print_step() {
    echo -e "${CYAN}[STEP]${NC} $1"
}

print_info() {
    echo -e "${BLUE}[INFO]${NC} $1"
}

print_success() {
    echo -e "${GREEN}[✓]${NC} $1"
}

print_warning() {
    echo -e "${YELLOW}[WARNING]${NC} $1"
}

print_error() {
    echo -e "${RED}[ERROR]${NC} $1"
}

# Função para obter nome do projeto
get_project_name() {
    if [ -z "$1" ]; then
        read -p "Digite o nome do projeto (padrão: php-docker-project): " project_name
        project_name=${project_name:-php-docker-project}
    else
        project_name=$1
    fi
    
    # Sanitizar nome do projeto
    project_name=$(echo "$project_name" | tr '[:upper:]' '[:lower:]' | sed 's/[^a-z0-9-]/-/g' | sed 's/--*/-/g')
    echo "$project_name"
}

# Função para criar estrutura de diretórios
create_directory_structure() {
    local project_dir=$1
    
    print_step "Criando estrutura de diretórios..."
    
    # Criar diretório principal
    mkdir -p "$project_dir"
    cd "$project_dir"
    
    # Estrutura de diretórios
    local dirs=(
        "src/public"
        "src/app"
        "src/config"
        "src/includes"
        "logs"
        "mysql/init"
        "docker/php"
        "docker/apache"
        "backups"
        "docs"
    )
    
    for dir in "${dirs[@]}"; do
        mkdir -p "$dir"
        print_success "Criado: $dir/"
    done
}

# Função para criar configurações do Apache
create_apache_config() {
    print_step "Criando configurações do Apache..."
    
    cat > docker/apache/000-default.conf << 'EOF'
<VirtualHost *:80>
    ServerAdmin webmaster@localhost
    DocumentRoot /var/www/html/public

    <Directory /var/www/html/public>
        Options Indexes FollowSymLinks
        AllowOverride All
        Require all granted
    </Directory>

    ErrorLog ${APACHE_LOG_DIR}/error.log
    CustomLog ${APACHE_LOG_DIR}/access.log combined
</VirtualHost>
EOF
    print_success "Configuração do Apache criada"
}

# Função para criar script SQL inicial
create_initial_sql() {
    print_step "Criando script SQL inicial..."
    
    cat > mysql/init/init.sql << EOF
-- Script de inicialização do banco de dados

-- Criar o banco de dados se não existir
CREATE DATABASE IF NOT EXISTS \`${project_name}_db\`;

-- Usar o banco de dados
USE \`${project_name}_db\`;

-- Criar usuário se não existir
CREATE USER IF NOT EXISTS \`${project_name}_user\`@'%' IDENTIFIED BY 'secret123';

-- Conceder privilégios
GRANT ALL PRIVILEGES ON \`${project_name}_db\`.* TO \`${project_name}_user\`@'%';
FLUSH PRIVILEGES;

-- Tabela de exemplo
CREATE TABLE IF NOT EXISTS users (
    id INT AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    email VARCHAR(255) UNIQUE NOT NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

-- Inserir dados de exemplo
INSERT IGNORE INTO users (name, email) VALUES 
('Admin', 'admin@example.com'),
('Usuario Teste', 'teste@example.com');
EOF
    print_success "Script SQL inicial criado"
}

# Função para criar arquivos Docker
create_docker_files() {
    print_step "Criando arquivos Docker..."
    
    # Dockerfile
    cat > Dockerfile << 'EOF'
# Dockerfile
ARG PHP_VERSION=8.2
FROM php:${PHP_VERSION}-apache

# Instalar dependências do sistema
RUN apt-get update && apt-get install -y \
    git \
    curl \
    libpng-dev \
    libonig-dev \
    libxml2-dev \
    libzip-dev \
    libfreetype6-dev \
    libjpeg62-turbo-dev \
    libmcrypt-dev \
    libpq-dev \
    zip \
    unzip \
    nano \
    vim \
    wget \
    && rm -rf /var/lib/apt/lists/*

# Instalar extensões PHP
RUN docker-php-ext-configure gd --with-freetype --with-jpeg \
    && docker-php-ext-install \
    pdo_mysql \
    pdo_pgsql \
    mbstring \
    exif \
    pcntl \
    bcmath \
    gd \
    zip \
    xml \
    intl \
    opcache \
    && pecl install redis \
    && docker-php-ext-enable redis

# Instalar Composer
COPY --from=composer:latest /usr/bin/composer /usr/bin/composer

# Configurar Apache
RUN a2enmod rewrite
RUN a2enmod headers
RUN a2enmod ssl

# Configurar DocumentRoot
ENV APACHE_DOCUMENT_ROOT /var/www/html/public
RUN sed -ri -e 's!/var/www/html!${APACHE_DOCUMENT_ROOT}!g' /etc/apache2/sites-available/*.conf
RUN sed -ri -e 's!/var/www/!${APACHE_DOCUMENT_ROOT}!g' /etc/apache2/apache2.conf /etc/apache2/conf-available/*.conf

# Criar diretório public se não existir
RUN mkdir -p /var/www/html/public

# Definir permissões
RUN chown -R www-data:www-data /var/www/html
RUN chmod -R 755 /var/www/html

# Configuração customizada do PHP
COPY docker/php/php.ini /usr/local/etc/php/conf.d/custom.ini
COPY docker/apache/000-default.conf /etc/apache2/sites-available/000-default.conf

WORKDIR /var/www/html

EXPOSE 80

CMD ["apache2-foreground"]
EOF
    print_success "Dockerfile criado"

    # docker-compose.yml
    cat > docker-compose.yml << 'EOF'
version: '3.8'

services:
  php-app:
    build:
      context: .
      dockerfile: Dockerfile
      args:
        PHP_VERSION: ${PHP_VERSION:-8.2}
    container_name: ${PROJECT_NAME:-php-app}-${PHP_VERSION:-8.2}
    ports:
      - "${APP_PORT:-8080}:80"
    volumes:
      - ./src:/var/www/html
      - ./logs:/var/log/apache2
      - ./docker/apache:/etc/apache2/sites-available
    environment:
      - PHP_VERSION=${PHP_VERSION:-8.2}
      - PROJECT_NAME=${PROJECT_NAME:-php-app}
      - DB_HOST=mysql
      - DB_DATABASE=${DB_DATABASE:-app_db}
      - DB_USERNAME=${DB_USERNAME:-app_user}
      - DB_PASSWORD=${DB_PASSWORD:-app_pass}
      - DB_PORT=${DB_PORT:-3306}
    depends_on:
      - mysql
      - redis
    networks:
      - app-network

  mysql:
    image: mysql:${MYSQL_VERSION:-8.0}
    container_name: ${PROJECT_NAME:-php-app}-mysql
    ports:
      - "${DB_PORT:-3306}:3306"
    environment:
      MYSQL_ROOT_PASSWORD: ${DB_ROOT_PASSWORD:-root}
      MYSQL_DATABASE: ${DB_DATABASE:-app_db}
      MYSQL_USER: ${DB_USERNAME:-app_user}
      MYSQL_PASSWORD: ${DB_PASSWORD:-app_pass}
    volumes:
      - mysql_data:/var/lib/mysql
      - ./mysql/init:/docker-entrypoint-initdb.d
      - ./backups:/backups
    networks:
      - app-network

  redis:
    image: redis:${REDIS_VERSION:-7-alpine}
    container_name: ${PROJECT_NAME:-php-app}-redis
    ports:
      - "${REDIS_PORT:-6379}:6379"
    volumes:
      - redis_data:/data
    networks:
      - app-network

  phpmyadmin:
    image: phpmyadmin/phpmyadmin
    container_name: ${PROJECT_NAME:-php-app}-phpmyadmin
    ports:
      - "${PMA_PORT:-8081}:80"
    environment:
      PMA_HOST: mysql
      PMA_USER: root
      PMA_PASSWORD: ${DB_ROOT_PASSWORD:-root}
    depends_on:
      - mysql
    networks:
      - app-network

  mailhog:
    image: mailhog/mailhog
    container_name: ${PROJECT_NAME:-php-app}-mailhog
    ports:
      - "${MAIL_WEB_PORT:-8025}:8025"
      - "${MAIL_SMTP_PORT:-1025}:1025"
    networks:
      - app-network

volumes:
  mysql_data:
  redis_data:

networks:
  app-network:
    driver: bridge
EOF
    print_success "docker-compose.yml criado"
}

# Função para criar arquivo .env
create_env_file() {
    print_step "Criando arquivo de configuração (.env)..."
    
    cat > .env << EOF
# Configurações do Projeto
PROJECT_NAME=$project_name

# Versões
PHP_VERSION=8.2
MYSQL_VERSION=8.0
REDIS_VERSION=7-alpine

# Portas da aplicação
APP_PORT=8080
DB_PORT=3306
REDIS_PORT=6379
PMA_PORT=8081
MAIL_WEB_PORT=8025
MAIL_SMTP_PORT=1025

# Configurações do MySQL
DB_ROOT_PASSWORD=root
DB_DATABASE=${project_name}_db
DB_USERNAME=${project_name}_user
DB_PASSWORD=secret123

# Configurações do ambiente
APP_ENV=development
APP_DEBUG=true
APP_URL=http://localhost:8080
EOF
    print_success ".env criado"
}

# Função para criar configurações PHP
create_php_config() {
    print_step "Criando configurações PHP..."
    
    cat > docker/php/php.ini << 'EOF'
; Configurações customizadas do PHP

; Limites de memória e tempo
memory_limit = 512M
max_execution_time = 300
max_input_time = 300

; Upload de arquivos
upload_max_filesize = 100M
post_max_size = 100M
max_file_uploads = 50

; Configurações de erro
display_errors = On
display_startup_errors = On
error_reporting = E_ALL
log_errors = On
error_log = /var/log/apache2/php_errors.log

; Configurações de sessão
session.gc_maxlifetime = 3600
session.cookie_lifetime = 0
session.save_handler = redis
session.save_path = "tcp://redis:6379"

; Timezone
date.timezone = America/Sao_Paulo

; OPcache (recomendado para produção)
opcache.enable = 1
opcache.memory_consumption = 256
opcache.interned_strings_buffer = 16
opcache.max_accelerated_files = 10000
opcache.revalidate_freq = 2
opcache.fast_shutdown = 1
opcache.validate_timestamps = 1

; Configurações de email (para desenvolvimento)
sendmail_path = "/usr/sbin/sendmail -t -i -S mailhog:1025"

; Outras configurações úteis
allow_url_fopen = On
auto_detect_line_endings = On
EOF
    print_success "Configuração PHP criada"
}

