# Função para criar script de gerenciamento
create_management_script() {
    print_step "Criando script de gerenciamento..."
    
    cat > manage.sh << 'EOF'
#!/bin/bash

# Script para gerenciar o ambiente PHP Docker

set -e

# Cores para output
RED='\033[0;31m'
GREEN='\033[0;32m'
YELLOW='\033[1;33m'
BLUE='\033[0;34m'
NC='\033[0m'

print_info() { echo -e "${BLUE}[INFO]${NC} $1"; }
print_success() { echo -e "${GREEN}[SUCCESS]${NC} $1"; }
print_warning() { echo -e "${YELLOW}[WARNING]${NC} $1"; }
print_error() { echo -e "${RED}[ERROR]${NC} $1"; }

# Verificar dependências
check_dependencies() {
    if ! command -v docker &> /dev/null; then
        print_error "Docker não está instalado!"
        exit 1
    fi
    if ! command -v docker-compose &> /dev/null; then
        print_error "Docker Compose não está instalado!"
        exit 1
    fi
}

# Carregar variáveis do .env
load_env_variables() {
    if [ -f .env ]; then
        export $(grep -v '^#' .env | xargs)
        print_info "Variáveis do .env carregadas"
    else
        print_warning "Arquivo .env não encontrado. Usando valores padrão."
    fi
}

# Função para iniciar containers
start_containers() {
    print_info "Usando PHP versão: ${PHP_VERSION:-8.2}"
    print_info "Construindo e iniciando containers..."
    docker-compose up --build -d
    if [ $? -eq 0 ]; then
        print_success "Containers iniciados!"
        print_info "Aplicação: http://localhost:${APP_PORT:-8080}"
        print_info "phpMyAdmin: http://localhost:${PMA_PORT:-8081}"
        print_info "MailHog: http://localhost:${MAIL_WEB_PORT:-8025}"
    else
        print_error "Erro ao iniciar containers."
        exit 1
    fi
}

# Função para parar containers
stop_containers() {
    print_info "Parando containers..."
    docker-compose down
    if [ $? -eq 0 ]; then
        print_success "Containers parados"
    else
        print_error "Erro ao parar containers."
        exit 1
    fi
}

# Função para reiniciar containers
restart_containers() {
    stop_containers
    start_containers
}

# Função para mostrar status dos containers
status_containers() {
    print_info "Status dos containers:"
    docker-compose ps
}

# Função para ver logs
view_logs() {
    if [ -z "$1" ]; then
        print_info "Exibindo logs de todos os serviços..."
        docker-compose logs -f
    else
        print_info "Exibindo logs do serviço $1..."
        docker-compose logs -f $1
    fi
}

# Função para executar comando no container PHP
exec_php() {
    local cmd="$@"
    print_info "Executando comando no container PHP: $cmd"
    docker-compose exec php-app bash -c "$cmd"
}

# Função para executar composer
exec_composer() {
    local cmd="$@"
    print_info "Executando Composer: composer $cmd"
    docker-compose exec php-app composer $cmd
}

# Função para trocar versão do PHP
switch_php_version() {
    local new_version=$1
    if [ -z "$new_version" ]; then
        print_error "Uso: ./manage.sh switch <versão_php> (ex: 8.0, 8.1, 8.2, 8.3)"
        exit 1
    fi

    # Validar versão
    case "$new_version" in
        "8.0"|"8.1"|"8.2"|"8.3")
            ;;
        *)
            print_error "Versão do PHP inválida: $new_version. Versões suportadas: 8.0, 8.1, 8.2, 8.3"
            exit 1
            ;;
    esac

    print_info "Trocando versão do PHP para $new_version..."
    
    # Atualizar .env
    sed -i ".bak" "s/^PHP_VERSION=.*/PHP_VERSION=$new_version/" .env
    print_success "Versão do PHP atualizada no .env"

    # Reconstruir e reiniciar o serviço php-app
    print_info "Reconstruindo e reiniciando o serviço php-app..."
    stop_containers
    docker-compose up --build -d php-app
    start_containers
    if [ $? -eq 0 ]; then
        print_success "Versão do PHP alterada para $new_version com sucesso!"
        restart_containers
        print_success "Reinicie com ./manage.sh restart para aplicar as modificações"
    else
        print_error "Erro ao trocar a versão do PHP."
        exit 1
    fi
}

# Função para backup do MySQL
backup_mysql() {
    print_info "Realizando backup do MySQL..."
    load_env_variables # Garante que as variáveis do .env estão carregadas
    local timestamp=$(date +%Y%m%d_%H%M%S)
    local backup_file="./backups/${DB_DATABASE:-app_db}_${timestamp}.sql"
    docker-compose exec mysql mysqldump -u${DB_USERNAME:-app_user} -p${DB_PASSWORD:-app_pass} ${DB_DATABASE:-app_db} > "$backup_file"
    if [ $? -eq 0 ]; then
        print_success "Backup concluído: $backup_file"
    else
        print_error "Erro ao realizar backup do MySQL."
        exit 1
    fi
}

# Função para restaurar MySQL
restore_mysql() {
    local backup_file=$1
    if [ -z "$backup_file" ]; then
        print_error "Uso: ./manage.sh restore <caminho_do_arquivo_sql>"
        exit 1
    fi

    if [ ! -f "$backup_file" ]; then
        print_error "Arquivo de backup não encontrado: $backup_file"
        exit 1
    fi

    print_info "Restaurando backup do MySQL de $backup_file..."
    load_env_variables # Garante que as variáveis do .env estão carregadas
    docker-compose exec -T mysql mysql -u${DB_USERNAME:-app_user} -p${DB_PASSWORD:-app_pass} ${DB_DATABASE:-app_db} < "$backup_file"
    if [ $? -eq 0 ]; then
        print_success "Backup restaurado com sucesso!"
    else
        print_error "Erro ao restaurar backup do MySQL."
        exit 1
    fi
}

# Função para limpar ambiente Docker
clean_environment() {
    print_warning "Isso irá remover todos os containers, imagens e volumes!"
    read -p "Tem certeza? (y/N): " confirm
    if [[ "$confirm" =~ ^[yY]$ ]]; then
        print_info "Removendo containers, imagens e volumes..."
        docker-compose down --rmi all --volumes
        if [ $? -eq 0 ]; then
            print_success "Limpeza concluída"
        else
            print_error "Erro durante a limpeza do ambiente."
            exit 1
        fi
    else
        print_info "Limpeza cancelada."
    fi
}

# Função para exibir ajuda
show_help() {
    echo "Uso: ./manage.sh [comando]"
    echo ""
    echo "Comandos disponíveis:"
    echo "  start           Iniciar containers"
    echo "  stop            Parar containers"
    echo "  restart         Reiniciar containers"
    echo "  status          Mostrar status dos containers"
    echo "  logs [serviço]  Ver logs (todos ou de um serviço específico)"
    echo "  exec <comando>  Executar comando no container PHP"
    echo "  composer <cmd>  Executar comando do Composer"
    echo "  switch <versão> Trocar versão do PHP (8.0, 8.1, 8.2, 8.3)"
    echo "  backup          Fazer backup do MySQL"
    echo "  restore <file>  Restaurar backup do MySQL"
    echo "  clean           Limpar ambiente Docker"
    echo "  help            Exibir esta ajuda"
}

# Função principal
main() {
    check_dependencies
    load_env_variables

    case "${1:-help}" in
        start)
            start_containers
            ;;
        stop)
            stop_containers
            ;;
        restart)
            restart_containers
            ;;
        status)
            status_containers
            ;;
        logs)
            view_logs "$2"
            ;;
        exec)
            shift
            exec_php "$@"
            ;;
        composer)
            shift
            exec_composer "$@"
            ;;
        switch)
            switch_php_version "$2"
            ;;
        backup)
            backup_mysql
            ;;
        restore)
            restore_mysql "$2"
            ;;
        clean)
            clean_environment
            ;;
        help|*)
            show_help
            ;;
    esac
}

# Executar função principal
main "$@"
